import React from 'react'
import Box from '@mui/material/Box'

function InputDisplay({type, value, name}) {
    return (
        <div>
            <Box sx={{mb:3}}>
                Name: {name} <br/>
                Value: {value} <br/>
                Type: {type}
            </Box>
        </div>
    )
}


export default InputDisplay
